/**
 *
 * @param image
 * @return an integer between 0 and 35 containing the prediction
 */


int DeepNeuralNetwork::inference(const int image[][INPUT_IMAGE_SIZE]) {
    float input[INPUT_IMAGE_SIZE][INPUT_IMAGE_SIZE];

    for (int i = 0; i < INPUT_IMAGE_SIZE; i++)
        for (int j = 0; j < INPUT_IMAGE_SIZE; j++)
            input[i][j] = image[i][j];

    conv2d_1(input, conv2D_1_kernels, conv2d_1_output);
    maxpool2d_1(conv2d_1_output, maxpool_1_output);

    conv2d_2(maxpool_1_output, conv2D_2_kernels, conv2d_2_output);
    maxpool2d_2(conv2d_2_output, maxpool_2_output);

    conv2d_3(maxpool_2_output, conv2d_3_kernels, conv2d_3_output);
    maxpool2d_3(conv2d_3_output, maxpool_3_output);

    flatten(maxpool_3_output, flatten_output);

    dense_1(flatten_output, dense_1_output);
    dense_2(dense_1_output, dense_2_output);

    float max = dense_2_output[0];
    int maxIndex = 0;
    for (int i = 0; i < DENSE_2_OUTPUT_SIZE; i++) {
        if (dense_2_output[i] > max) {
            max = dense_2_output[i];
            maxIndex = i;
        }
    }

    for (int i = 0; i < DENSE_2_OUTPUT_SIZE; i++) {
        //  std::cout << "Neuron " << i << ": " << dense_output[i] << std::endl;
    }
    char prediction;
    if (maxIndex < 10)
        prediction = maxIndex + '0';
    else
        prediction = maxIndex - 10 + 'A';
    //std::cout << "Inference neuron: " << maxIndex << std::endl;
    //std::cout << "Inference letter: " << prediction << std::endl;
    //std::cout << std::endl;
    return maxIndex;
}

void DeepNeuralNetwork::conv2d_1(const float input[][CONV2D_1_INPUT_SIZE], const float kernel[][CONV2D_SIZE][CONV2D_SIZE], float output[][CONV2D_1_OUTPUT_SIZE][CONV2D_1_OUTPUT_SIZE]) {
    for (int w = 0; w < CONV2D_1_FILTERS; w++) {
        for (int i = 0; i < CONV2D_1_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV2D_1_OUTPUT_SIZE; j++) {
                float res = 0;
                for (int k = 0; k < CONV2D_SIZE; k++) {
                    for (int m = 0; m < CONV2D_SIZE; m++) {
                        int row = i + k;
                        int col = j + m;
                        float mul = input[row][col] * kernel[w][k][m];
                        res = res + mul;
                    }
                }
                output[w][i][j] = leaky_relu(res);
            }
        }
    }
}
void DeepNeuralNetwork::maxpool2d_1(const float input[][MAX_POOL_1_INPUT_SIZE][MAX_POOL_1_INPUT_SIZE], float output[][MAX_POOL_1_OUTPUT_SIZE][MAX_POOL_1_OUTPUT_SIZE]) {
    for (int k = 0; k < CONV2D_1_FILTERS; k++)
        for (int i = 0; i < MAX_POOL_1_OUTPUT_SIZE; i++)
            for (int j = 0; j < MAX_POOL_1_OUTPUT_SIZE; j++)
                output[k][i][j] = 0;

    for (int k = 0; k < CONV2D_1_FILTERS; k++) {
        for (int y = 0; y < MAX_POOL_1_OUTPUT_SIZE; ++y) {
            for (int x = 0; x < MAX_POOL_1_OUTPUT_SIZE; ++x) {
                for (int i = 0; i < MAX_POOL_SIZE; ++i) {
                    for (int j = 0; j < MAX_POOL_SIZE; ++j) {
                        float value = input[k][y * MAX_POOL_SIZE + i][x * MAX_POOL_SIZE + j];
                        output[k][y][x] = std::max(output[k][y][x], value);
                    }
                }
            }
        }
    }
}

void DeepNeuralNetwork::conv2d_2(const float input[][CONV2D_2_INPUT_SIZE][CONV2D_2_INPUT_SIZE], const float kernel[][CONV2D_2_FILTERS][CONV2D_SIZE][CONV2D_SIZE], float output[][CONV2D_2_OUTPUT_SIZE][CONV2D_2_OUTPUT_SIZE]) {
    for (int w = 0; w < CONV2D_2_FILTERS; w++) {
        for (int i = 0; i < CONV2D_2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV2D_2_OUTPUT_SIZE; j++) {
                float res = 0;
                for (int k = 0; k < CONV2D_SIZE; k++) {
                    for (int m = 0; m < CONV2D_SIZE; m++) {
                        for (int c = 0; c < CONV2D_1_FILTERS; c++) {
                            int row = i + k;
                            int col = j + m;
                            float mul = input[c][row][col] * kernel[c][w][k][m];
                            res = res + mul;
                        }
                    }
                }
                output[w][i][j] = leaky_relu(res);
            }
        }
    }
}

void DeepNeuralNetwork::maxpool2d_2(const float input[][MAX_POOL_2_INPUT_SIZE][MAX_POOL_2_INPUT_SIZE], float output[][MAX_POOL_2_OUTPUT_SIZE][MAX_POOL_2_OUTPUT_SIZE]) {
    for (int k = 0; k < CONV2D_2_FILTERS; k++)
        for (int i = 0; i < MAX_POOL_2_OUTPUT_SIZE; i++)
            for (int j = 0; j < MAX_POOL_2_OUTPUT_SIZE; j++)
                output[k][i][j] = 0;

    for (int k = 0; k < CONV2D_2_FILTERS; k++) {
        for (int y = 0; y < MAX_POOL_2_OUTPUT_SIZE; ++y) {
            for (int x = 0; x < MAX_POOL_2_OUTPUT_SIZE; ++x) {
                for (int i = 0; i < MAX_POOL_SIZE; ++i) {
                    for (int j = 0; j < MAX_POOL_SIZE; ++j) {
                        float value = input[k][y * MAX_POOL_SIZE + i][x * MAX_POOL_SIZE + j];
                        output[k][y][x] = std::max(output[k][y][x], value);
                    }
                }
            }
        }
    }
}

void DeepNeuralNetwork::conv2d_3(const float input[][CONV2D_3_INPUT_SIZE][CONV2D_3_INPUT_SIZE], const float kernel[][CONV2D_3_FILTERS][CONV2D_SIZE][CONV2D_SIZE], float output[][CONV2D_3_OUTPUT_SIZE][CONV2D_3_OUTPUT_SIZE]) {
    for (int w = 0; w < CONV2D_3_FILTERS; w++) {
        for (int i = 0; i < CONV2D_3_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV2D_3_OUTPUT_SIZE; j++) {
                float res = 0;
                for (int k = 0; k < CONV2D_SIZE; k++) {
                    for (int m = 0; m < CONV2D_SIZE; m++) {
                        for (int c = 0; c < CONV2D_2_FILTERS; c++) {
                            int row = i + k;
                            int col = j + m;
                            float mul = input[c][row][col] * kernel[c][w][k][m];
                            res = res + mul;
                        }
                    }
                }
                output[w][i][j] = leaky_relu(res);
            }
        }
    }
}
void DeepNeuralNetwork::maxpool2d_3(const float input[][MAX_POOL_3_INPUT_SIZE][MAX_POOL_3_INPUT_SIZE], float output[][MAX_POOL_3_OUTPUT_SIZE][MAX_POOL_3_OUTPUT_SIZE]) {
    for (int k = 0; k < CONV2D_3_FILTERS; k++)
        for (int i = 0; i < MAX_POOL_3_OUTPUT_SIZE; i++)
            for (int j = 0; j < MAX_POOL_3_OUTPUT_SIZE; j++)
                output[k][i][j] = 0;

    for (int k = 0; k < CONV2D_3_FILTERS; k++) {
        for (int y = 0; y < MAX_POOL_3_OUTPUT_SIZE; ++y) {
            for (int x = 0; x < MAX_POOL_3_OUTPUT_SIZE; ++x) {
                for (int i = 0; i < MAX_POOL_SIZE; ++i) {
                    for (int j = 0; j < MAX_POOL_SIZE; ++j) {
                        float value = input[k][y * MAX_POOL_SIZE + i][x * MAX_POOL_SIZE + j];
                        output[k][y][x] = std::max(output[k][y][x], value);
                    }
                }
            }
        }
    }
}

void DeepNeuralNetwork::flatten(const float input[][FLATTEN_INPUT_SIZE][FLATTEN_INPUT_SIZE], float *output) {
    for (int k = 0; k < CONV2D_3_FILTERS; k++)
        for (int i = 0; i < FLATTEN_INPUT_SIZE; i++)
            for (int j = 0; j < FLATTEN_INPUT_SIZE; j++)
                output[k * (FLATTEN_INPUT_SIZE * FLATTEN_INPUT_SIZE) + i * FLATTEN_INPUT_SIZE + j] = input[k][i][j];
}

void DeepNeuralNetwork::dense_1(const float *input, float *output) {
    for (int i = 0; i < DENSE_1_OUTPUT_SIZE; i++)
        output[i] = 0;

    for (int i = 0; i < DENSE_1_INPUT_SIZE; i++)
        for (int j = 0; j < DENSE_1_OUTPUT_SIZE; j++)
            output[j] += dense_1_weights[i * DENSE_1_OUTPUT_SIZE + j] * input[i];
}
void DeepNeuralNetwork::dense_2(const float *input, float *output) {
    for (int i = 0; i < DENSE_2_OUTPUT_SIZE; i++)
        output[i] = 0;

    for (int i = 0; i < DENSE_2_INPUT_SIZE; i++)
        for (int j = 0; j < DENSE_2_OUTPUT_SIZE; j++)
            output[j] += dense_2_weights[i * DENSE_2_OUTPUT_SIZE + j] * input[i];
}

float DeepNeuralNetwork::leaky_relu(float x) {
    if (x >= 0)
        return x;
    return 0.01 * x;
}

char DeepNeuralNetwork::label_to_char(int label) {
    if (label < 10)
        return label + '0';
    return label - 10 + 'A';
}
